var $$ = (s) => Array.from(document.querySelectorAll(s));

var fetchFile = function(url, responseType, whenLoaded)
{
    var oReq = new XMLHttpRequest();
    oReq.open("GET", url, true);
    oReq.responseType = responseType;
    oReq.onload = () => whenLoaded(oReq.response);
    oReq.send(null);
};

var getCleanName = function(songPath) {
	var [_, score, cleanName, comment] = 
		/^\.?\/?(0_[A-Za-z0-9]+_)?([^\(]+)(\(.*\))?.mid$/
			.exec(songPath);
	cleanName = cleanName.replace(/[\-\/_]/g, ' ');
	
	return cleanName;
};

