var songs = getSongs();

var getLinks = function(songPath) {
	var cleanName = getCleanName(songPath);
	$$('#masthead-search-term')[0].value = cleanName;
	$$('.search-btn-component')[0].click();

	setTimeout(function() {
		var links = [...new Set($$('#results a')
			.map(a => a.href
				.substr(0, 'https://www.youtube.com/watch?v=9h1xp4PNOEM'.length)
				.substr('https://www.youtube.com/watch?v='.length))
			.filter(url => url.startsWith('https://www.youtube.com/watch?v='))
		)];
		
		var baseUrl = 'https://intranet.dyninno.net/~aklesuns/scripts/acceptSongVideoLink.php';
		var url = baseUrl + '?json=' + JSON.stringify({ songPath: songPath, links: links });
		fetchFile(url, 'text', a => console.log(a, songPath));
	}, 1000);
};

